import Link from "next/link";

const Index = () => (
  <div>
    <Link href="/about">
      <a>About</a>
    </Link>
    <Link href="/how">
      <a>How</a>
    </Link>
    <Link href="/contact">
      <a>Contact</a>
    </Link>
    <p>Hello Next.js</p>
  </div>
);

export default Index;
